import images from "../images";

const citationPlaylist = [
    {
        title: "citation 1",
        nom : "General Leclerc",
        image : images.citation,
        text : "lorem ipsum",

    },
    {
        title: "citation 2",
        nom : "perso 2",
        image : images.citation,
        text : "lorem ipsum 2",

    },
    {
        title: "citation 3",
        nom : "perso 3",
        image : images.citation,
        text : "lorem ipsum 3",
    },
]

export default citationPlaylist;
